result:
query {
  posts:allContentfulBlogPost(sortBy: "publishedDate", order: DESC, limit: 3, filter:{categories:{contains:"Featured"}}) {
    edges {
      node {
        id
        title
        slug
        categories
        publishedDate(format:"MMMM D, Y")
        anchorText
        featuredImage {
          description
          file {
            url
          }
        }
    	}
  	}
	}
}
